const Blogs = (props) => {

    const Content = (props) => {
        return (
            <div>
                <h3>{props.blogsTitle}</h3>
                <p>{props.blogsAuthor}</p>
            </div>
        )
    }

    return (
        <div>
            {props.blogs.map(blog => <Content key={blog.id} blogsTitle={blog.title} blogsAuthor={blog.author} />)}
        </div>
    )
}

export default Blogs
